  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bear River Migratory
  Bird Refuge outlines Refuge accomplishments from September through December of 1943.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, collections and receipts,
  and wildfires. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, hunting, and violations. N-R forms are attached.\",\n\t\"owner_org\":
